import './FeatureButtonStyle.scss';

function FeatureButton(props: {title: string, onClick: any;}){
    return (
        <div className="feature-button" onClick={props.onClick} style={{backgroundColor: 'green'}}>
            <div className="feature-button-title">{props.title}</div>
        </div>
    );
}
export default FeatureButton;
